u($,"a0h","QJ",function(){var t="author_namalengkap",s="Redaksi Partai Perindo",r="https://lh3.googleusercontent.com/k2yEDmuza1AkV2_hBi25ZbLUjJCWPtZT1ELdPJlurLk8165jowzDvVpPF0f7G8kxPJo=s512-rw",q=P.m
return H.d([P.e(["id","1","title","MNC NOW Tawarkan Channel TV Lokal, Film, dan Serial TV Gratis Selamanya","news","JAKARTA \u2013 Aplikasi penyedia layanan streaming TV dan Video on Demand (VOD) MNC Now kian memberikan ragam konten pilihan bagi para pengguna secara Gratis Selamanya.\nBerhasil meraup sebanyak 2,8 juta pengguna baru dalam kurun waktu yang sangat singkat, MNC Now kian memberikan pelayanan terbaik bagi para penggunanya mulai dari tambahan konten-konten pilihan dan penawaran yang menarik untuk dinikmati melalui perangkat smartphone dan tablet, dimana saja dan kapan saja.\n\nBeberapa konten fresh tersebut diantaranya film \u20183 Dara 2\u2019, \u2018Rompis\u2019, \u2018Koki-Koki Cilik\u2019 yang merupakan produksi MNC Pictures dan baru rilis di tahun 2018 di bioskop-bioskop Tanah Air kini hadir secara eksklusif di MNC Now.\nAda pula konten video pendek \u2018Popular\u2019 produksi Papilon yang membahas seputar topik menarik untuk pria dewasa dan dibintangi model cantik dan sexy, serta kumpulan video kompetisi game super seru khusus bagi penggemar e-sport. Ribuan jam film dan serial TV lainnya juga hadir secara eksklusif dan gratis di aplikasi MNC Now.\nTidak hanya itu, MNC Now juga merupakan aplikasi dunia olahraga dan hiburan terlengkap yang menyajikan channel TV lokal terlengkap, dengan tambahan channel internasional serta premium.\n\nKhusus untuk pelanggan MNC Vision dan MNC Play, dapat melakukan \u2018Connect\u2019 dengan memasukkan nomor ID pelanggan dan tanggal lahir agar dapat menonton lebih dari 130* channel lokal & premium favorit sesuai paket berlangganannya di aplikasi MNC Now. Fitur \u2018Connect\u2019 ini juga dapat dinikmati hingga 5 perangkat yang berbeda.\nSemakin melengkapi kebutuhan para pengguna yang memiliki kesibukan dan mobilitas yang tinggi, MNC Now juga memiliki fitur \u2018Catch Up TV\u2019 yang memungkinkan untuk memutar kembali program TV terlewat hingga 7 hari kebelakang.\nTidak hanya itu, MNC Now juga memberikan apresiasi kepada pengguna setia MNC Now dengan menyelenggarakan undian dan kuis berhadiah. Sejak Februari 2019 lalu, MNC Now kembali mengadakan Undian Gratis Berhadiah \u2018MaMen (Masuk Menang) 2\u2019 dengan total hadiah sebanyak 260 unit HP Samsung J6+ dan 4 unit Samsung Note 9 yang akan diundi sampai dengan 20 Agustus 2019.\nCara mengikutinya sangat mudah, peserta hanya tinggal mengunduh aplikasi MNC Now di Google Play/App Store lalu mendaftarkan alamat emailnya. Pengumuman 10 unit Samsung J6+ akan diumumkan setiap minggu sementara hadiah 2 unit Samsung Note 9 diumumkan setiap 3 bulan sekali.\nSelain Undian \u2018MaMen 2\u2019, MNC Now juga membagikan 15 voucher pulsa bernilai Rp. 25.000,- setiap Senin - Jumat melalui Kuis \u2018Watch & Win\u2019. Peserta hanya tinggal menunggu push notification dari aplikasi MNC Now untuk dapat mengetahui tentang informasi film yang akan disertakan sebagai kuis. Setelah itu peserta tinggal menunggu pertanyaan yang tertera di sela-sela film yang ditonton, lalu menjawabnya di menu \u2018Watch & Win\u2019 yang terdapat di pilihan menu pojok kiri atas aplikasi MNC Now.","urlphoto","https://img-o.okeinfo.net/content/2019/06/26/207/2071153/mnc-now-tawarkan-channel-tv-lokal-film-dan-serial-tv-gratis-selamanya-j8zYPDHYUT.jpeg","tglposting","26 Juni 2019  -  Pukul 15:03",t,s,"author_urlphoto",r],q,q),P.e(["id","2","title","Perindo: Kapasitas Capim KPK Harus Kuasai Persoalan Hukum","news","JAKARTA \u2013 Ketua DPW Partai Perindo Sulawesi Selatan, Sanusi Ramadhan mengatakan keseriusan pemerintah dalam membentuk tim panitia seleksi calon pimpinan (Pansel Capim) KPK menjadi bukti dan komitmen Presiden Joko Widodo dalam memberantas kejahatan korupsi di Tanah Air.\nMenurutnya, ada sejumlah kriteria yang patut dimiliki dan dipertimbangkan tim pansel dalam menentukan calon pimpinan KPK untuk periode 2019-2024 mendatang.\nDi antaranya, memiliki latar belakang yang bersih dari sanksi hukum maupun pelanggaran etik di masa lalu.\n\u201cSelain kapasitas yang terpenting adalah komitmen dan keberanian pimpinan KPK dalam memberantas korupsi,\u201d ujar Sanusi saat dihubungi Senin, (17/6/2019).\nSebagai institusi yang dipercaya masyarakat, KPK tidak boleh lemah dalam upaya pemberantasan korupsi yang mungkin bersarang di berbagai lembaga pemerintahan.\nKarenanya, pimpinan lembaga antirasuah harus memiliki integritas, keadilan dan profesionalisme dalam menjalankan tugasnya.\nSelain itu, Sanusi mengatakan komisioner KPK wajib memiliki pengetahuan mendalam terkait aturan serta hukum yang tepat untuk menjerat pelaku kejahatan korupsi.\nSehingga, KPK tidak salah langkah dalam menentukan keberlanjutan perkara korupsi.\n\u201cCalon pimpinan KPK juga harus menguasasi persoalan hukum itulah salah satu kapasitas yang harus dimiliki,\u201d katanya.\nSementara itu, pagi tadi Presiden Joko Widodo sudah bertemu dengan Tim Pansel Capim KPK di Istana Merdeka, Jakarta, Senin (176/2019).\nDalam pertemuan itu, sembilan anggota pansel mendapatkan mandat untuk bekerja maksimal dalam mendapatkan pimpinan KPK yang terbaik periode 2019-2024.\nDari hasil pertemuan tersebut, Presiden Jokowi menyampaikan kriteria yang harus dimiliki oleh pimpinan KPK ke depan yakni managerial skill yang sangat kuat.\nArtinya, pimpinan KPK tidak hanya memerlukan kemampuan investigatif saja. Namun juga kemampuan manejerial untuk mengatur tata kelola institusi.","urlphoto","https://partaiperindo.com/wp-content/uploads/2017/10/SANUSI-RAMADHAN1.jpg","tglposting","17 Jun 2019  -  Pukul 22:34",t,s,"author_urlphoto",r],q,q),P.e(["id","3","title","Libatkan LPSK di MK, BPN Terlalu Mendramatisir","news","JAKARTA \u2013 Rencana BPN Prabowo-Sandi melibatkan Lembaga Perlindungan Saksi dan Korban (LPSK) dinilai terlalu didramatisir. TKN Jokowi-Ma\u2019ruf menganggap kondisi tersebut bisa menimbulkan ketidaknyamanan saksi.\nWakil Ketua TKN Jokowi-Ma\u2019ruf, Ahmad Rafiq mengatakan, meski permohonan melindungi para saksi sekalipun dijamin oleh undang-undang namun permohonan ini terlalu dramatis dan terkesan ada persoalan yang membahayakan.\nSekjen Partai Perindo ini mengungkapkan, tidak ada pengalaman saksi mendapat intimidasi dalam memberikan keterangan di setiap pemilu dari tahun ke tahun. Dia mengatakan, situasi yang terjadi saat ini juga tidak terlihat ada nuansa panas apalagi membahayakan nyawa siapapun. \u201cSemua berjalan aman-aman saja,\u201d kata Rafiq lagi.\n\u201cSaya jadi ingin bertanya, yang menciptakan rasa tidak aman itu siapa? Jangan-jangan dibuat sendiri,\u201d tambahnya.\nSekretaris Jendral PKPI, Verry Surya Hendrawan menentang permintaan perlindungan saksi jika dilandasi dengan alasan yang negatif.\nDia mengatakan, perlindungan saksi lebih baik tidak diberikan jika hal itu dilakukan guna memperlihatkan seolah-olah persidangan tidak aman dan aparat gagal memberikan jaminan keamanan bagi masyarakat.\nMenurut Verry, alasan tersebut akan membuat permintaan perlindungan saksi dan ahli menjadi hal yang bersifat kontraproduktif. Permintaan dengan alasan yang tidak baik itu juga cenderung tendesius.\n\u201cSeolah-olah bahwa memberikan keterangan yang jujur di persidangan menjadi hal yang berbahaya dan rawan. Kesan seperti itu harus sama-sama kita hindari,\u201d katanya.\nSebelumnya, permintaan perlindungan saksi dan ahli diminta Ketua Tim Kuasa Hukum BPN Bambang Widjojanto (BW) kepada MK. Permohonan itu diajukan karena ada kekhawatiran akan adanya intervensi dari calon presiden (capres) pejawat.\nBW berpendapat, petahana mempunyai potensi menggunakan seluruh sumber dayanya. Alasan lain yang menjadi pertimbangan dimintanya perlindungan saksi oleh BW menyusul adanya potensi proses pemeriksaan di MK tidak bisa seluas-luasnya memberi akses keadilan.\nSementara, Jubir BPN Prabowo-Sandi, Andre Rosiade mengatakan, pihaknya akan menyurati MK terkait saksi.\n\u201cKeterlibatan LPSK ini diperlukan untuk menjamin rasa aman bagi saksi dan ahli yang dihadirkan pasangan capres dan cawapres 02 untuk kepentingan pembuktian pada persidangan sengketa Pemilu 2019 di MK,\u201d kata Andre.\nAndre mengatakan, setidaknya hingga saat ini sudah ada lebih kurang 30 saksi yang bersedia membongkar bukti kecurangan Pilpres 2019. Namun, dia mengatakan, mereka yang berasal dari sejumlah daerah di tanah air ini meminta jaminan keselamatan sebelum, saat, dan sesudah datang ke MK untuk bersaksi.\nPolitikus Gerindra ini mengatakan, demi keselamatan saat memberikan keterangan nanti, saksi yang dihadirkan dapat menggunakan sejumlah metode LPSK.\nMisalnya, bersaksi dari jarak jauh menggunakan teleconference, berbicara di ruangan bertirai hitam untuk menyamarkan lokasi saksi, hingga menyamarkan sejumlah informasi tentang saksi demi keselamatan pribadi.\nAndre mengatakan, tidak hanya bagi saksi yang akan memberikan keterangan dalam persidangan, tim hukum Prabowo-Sandi juga mendorong agar LPSK turut melindungi dan menjamin keamanan seluruh hakim MK.\nDia mengatakan hal itu agar mereka terlepas dari bentuk intervensi dan ancaman dalam memutuskan sengketa pilpres.\nSumber : rmco.id","urlphoto","https://partaiperindo.com/wp-content/uploads/2019/06/Screenshot_1.jpg","tglposting","17 Jun 2019  -  Pukul 11:00",t,s,"author_urlphoto",r],q,q),P.e(["id","4","title","TKN Minta BPN Tidak Mendramatisasi Ancaman terhadap Saksi","news","JAKARTA \u2013 Tim Kampanye Nasional (TKN) Joko Widodo (Jokowi) \u2013 Ma\u2019ruf Amin meminta Badan Pemenangan Nasional (BPN) Prabowo \u2013 Sandiaga tidak mendramatisir ancaman terhadap saksi. Sebab, saksi dilindungi dan dijamin Undang-Undang (UU).\nDemikian diungkapkan Wakil Sekretaris TKN Jokowi-Ma\u2019ruf Amin, Ahmad Rofiq setelah BPN meminta perlindungan 30 saksi yang akan hadir ke Mahkamah Konstitusi (MK) kepada Lembaga Perlindungan Saksi dan Korban (LPSK).\n\u201cPerlindungan terhadap saksi itu menjadi hak dan dijamin oleh undang-undang. Silahkan saja bila diperlukan. Yang penting jangan didramatisasi kalau ini ada ancaman, suasana mencekam,\u201d kata Rofiq kepada Okezone, Minggu (16/6/2019).\nMenurut Rofiq perlindungan terhadap 30 saksi yang akan dihadirkan BPN ke MK tidak terlalu diperlukan. Sebab, TKN melihat tidak ada ancaman dan teror terhadap BPN hingga saat ini.\n\u201cSaya lihat perlindungan itu tidak begitu diperlukan mengingat ancaman, teror dan lain-lain tidak ada sama sekali. Saya lihat semua kondusif dan saling menghormati satu sama lain. Tidak ada tekanan dan ancaman,\u201d terangnya.\nSebelumnya, tim hukum BPN menyebut ada 30 saksi yang akan dihadirkan dalam sidang Perselisihan Hasil Pemilihan Umum (PHPU). BPN meminta LPSK untuk menjamin keselamatan 30 saksinya tersebut.\nSumber : okezone.com","urlphoto","https://partaiperindo.com/wp-content/uploads/2019/06/tkn-minta-bpn-tidak-mendramatisasi-ancaman-terhadap-saksi-1KgLcH7jUo.jpg","tglposting","16 Jun 2019  -  Pukul 12:52",t,s,"author_urlphoto",r],q,q),P.e(["id","5","title","Kubu Prabowo Dinilai Berkhayal di Sidang MK","news","JAKARTA \u2013 Juru bicara Tim Kampanye Nasional (TKN) Joko Widodo-Ma\u2019ruf Amin Arya Sinulingga menilai bukti yang dilampirkan kubu Prabowo Subianto-Sandiaga Uno di Mahkamah Konstitusi (MK) cukup aneh. Semua tudingan yang disampaikan kubu pasangan capres dan cawapres 02 dinilai khayalan.\n\u201cDari persidangan terlihat bahwa 02 itu banyak membawa asumsi-asumsi. Istilahnya praduga tak bersalah,\u201d kata Arya kepada Medcom.id, Minggu, 16 Juni 2019.\nArya mencontohkan tudingan aparatur sipil negara (ASN) yang tak netral di Pilpres 2019. Kubu Prabowo-Sandiaga juga menuding Badan Intelijen Negara (BIN) berpihak karena menghadiri ulang tahun PDI Perjuangan.\nIa menilai tudingan itu tak dibarengi bukti autentik. Sehingga, tudingan itu hanya isapan jempol belaka. \u201cIni kan cuma asumsi, praduga tak bersalah,\u201d ujar Arya.\nPolitikus Partai Perindo itu menilai bukti yang dihadirkan kubu Prabowo-Sandiaga lemah. Tuduhan kecurangan terstruktur, sistematis, dan masif dari pasangan nomor urut 02 itu dinilai sebagai khayalan.\nArya juga menyebut deretan tuduhan yang disampaikan saat sidang perdana di Mahkamah Konstitusi tak berdasar. \u201cBanyak asumsi yang mereka bangun untuk argumen mereka. Jadi bukan bukti bahwa tuduhan mereka itu benar, tapi semuanya praduga tak bersalah. Ini kan aneh, bukan bukti bahwa adanya kecurangan\u201d tegas Arya.\nSumber : medcom.id","urlphoto","https://partaiperindo.com/wp-content/uploads/2019/06/Screenshot_109.jpg","tglposting","17 Jun 2019  -  Pukul 10:55",t,s,"author_urlphoto",r],q,q),P.e(["id","6","title","Sengketa Pilpres Digelar di MK, Perindo Harap Tak Ada Gangguan dari Pihak Luar","news","JAKARTA \u2013 Proses sidang pendahuluan Perselisihan Hasil Pemilihan Umum (PHPU) Presiden 2019 telah berlangsung di gedung Mahkamah Konstitusi, Jumat (14/6/2019).\nAdapun agenda sidang perdana hari ini, yakni pemeriksaan terhadap kejelasan dari pemohon sengketa Pilpres yang diajukan pasangan capres-cawapres Prabowo Subianto-Sandiaga Uno.\nArtinya, pemohon diberikan kesempatan untuk menyampaikan pokok-pokok permohonan di hadapan pihak termohon yaitu KPU dan pihak terkait, pasangan capres-cawapres Joko Widodo-KH Ma\u2019ruf Amin, dan pihak lainnya.\n\u201cBiasanya sidang perdana hanya memastikan legal standing dan kelengkapan materi gugatan. Sekiranya belum lengkap diberikan kesempatan untuk melengkapinya dalam waktu tertentu,\u201d ujar Ketua Bidang Keagamaan DPP Partai Perindo Abdul Khaliq Ahmad, Jumat (14/6/2019).\nKhaliq berharap disidang yang tengah digelar hari ini bisa berjalan dengan baik tanpa adanya gangguan dari pihak luar.\n\u201cJadi kita harapkan sidang berkelas negarawan tanpa ada kericuhan dan intervensi dari pihak lain. Jadilah pendukung paslon yang cerdas dan santun serta berkarakter,\u201d katanya.\nIa juga mengimbau agar para pendukung dari masing-masing calon untuk tidak ikut hadir ke persidangan MK.\nHal ini bertujuan untuk menjaga agar persidangan sengketa pemilu berjalan kondusif. Publik diminta untuk memantau jalannya persidangan melalui televisi.\n\u201cJadi bagi para pendukung paslon tak perlulah ikut hadir di persidangan. Lewat media massa sudah cukup. Jika perlu melalui streaming yang disiapkan MK,\u201d katanya.\nLebih lanjut, Khaliq kembali mengingatkan kepada publik untuk tidak meragukan kredibilitas serta independensi para hakim MK dalam mengatasi sidang sengketa hasil Pilpres 2019 tersebut.\n\u201cPercayakan segala proses peradilan kepada hakim-hakim MK yang credible dan profesional serta tim pengacara yang mewakili masing-masing paslon,\u201d katanya.\nSejak Jumat (14/6) pagi, MK mengelar sidang perdana gugatan Pilpres 2019. Dalam sidang tersebut dihadiri tim kuasa hukum baik dari kubu Prabowo-Sandi selaku pengugat, KPU selaku tergugat dan kuasa hukum Jokowi-Ma\u2019ruf Amin maupun Bawaslu selaku pihak terkait.\nSidang akan dilanjutkan pada Selasa, 18 Juni, dengan agenda mendengarkan tanggapan dari KPU.","urlphoto","https://partaiperindo.com/wp-content/uploads/2019/02/MK2.jpg","tglposting","14 Jun 2019  -  Pukul 19:30",t,s,"author_urlphoto",r],q,q),P.e(["id","7","title","Pemuda Perindo Ingatkan Pejabat Terima Gratifikasi Lapor ke KPK","news","JAKARTA \u2013 Ketua DPW Pemuda Perindo Banten Tulus Setyanto mengatakan penyelenggara negara yang melakukan gratifikasi atau menerima \u2018hadiah\u2019 bisa diindikasikan sebagai kejahatan korupsi jika tidak dilaporkan ke Komisi Pemberantasan Korupsi (KPK).\n\u201cUntuk pejabat negara, ASN, BUMN dan jajarannya aturannya itu sudah jelas terkait pelarangan pemberian gratifikasi, cuma praktiknya masih terjadi di momen lebaran seperti ini,\u201d ujarnya saat dihubungi, Jumat (14/6/2019).\nTulus mengimbau agar pejabat negara yang menerima \u2018hadiah\u2019 terkait perayaan Idul Fitri 2019 untuk segera melapor ke KPK. Agar status barang gratifikasi tersebut dapat ditetapkan menjadi milik negara, milik penerima atau ketentuan lain sesuai dengan aturan hukum tersebut.\nDi moment lebaran ini, terkadang gratifikasi bentuknya bermacam-macam tetapi tidak pantas pejabat menerimanya walaupun dengan bahasa berbagi karena hal tersebut jika dilakukan bisa menjadi pintu masuk korupsi.\n\u201cTetapi apabila sudah terlanjur menerima supaya segera melapor ke KPK, kan ada waktu untuk melapor 30 hari dari semenjak menerima gratifikasi supaya tidak terkena masalah,\u201d katanya.\nApabila aturan tersebut dapat diterapkan maka upaya pencegahan korupsi di lingkungan pemerintah daerah terkait penerimaan gratifikasi oleh pejabat publik dapat dihindari sedini mungkin.\n\u201cKalau ini dijalankan dan dipatuhi akan terwujud aparatur negara yang bersih dan bebas dari KKN,\u201d katanya.\nSebelumnya, KPK telah mengeluarkan Surat Edaran (SE) KPK tentang Imbauan Pencegahan Gratifikasi Terkait Hari Raya Keagamaan yang ditujukan kepada pimpinan instansi, kementerian, lembaga, organisasi, pemerintah daerah, BUMN dan BUMD pada 8 Mei 2019 lalu.\nHingga hari ini, KPK telah menerima 161 laporan gratifikasi terkait perayaan Lebaran 2019 yang diberikan kepada sejumlah pejabat negara atau pegawai negeri. Jumlah ini bertambah 67 laporan dari sebelumnya yang hanya 94 laporan pada 10 Juni 2019.","urlphoto","https://partaiperindo.com/wp-content/uploads/2019/01/kpk-akan-bongkar-suap-kalapas-sukamiskin-soal-jual-beli-fasilitas-gHHfUmanx41.jpg","tglposting","14 Jun 2019  -  Pukul 19:26",t,s,"author_urlphoto",r],q,q),P.e(["id","8","title","Ini Latar Belakang Calon Menteri Jokowi di Kabinet Kerja Jilid Dua Menurut TKN","news","JAKARTA \u2013 Juru Bicara Tim Kampanye Nasional Jokowi-Ma\u2019ruf Arya Sinulingga meyakini Presiden Joko Widodo alias Jokowi akan menarik orang-orang profesional dalam Kabinet Kerja jilid kedua. Menurut Arya, kriteria tersebut yang dicari Jokowi untuk membantunya pada periode kedua.\n\u201cYang penting profesional pasti,\u201d ucapnya kepada wartawan, Kamis (13/6).\nProfesional yang dimaksud, menurut Arya, tidak mendikotomi antara profesional dengan kader partai politik. Kata dia, dari kalangan partai pun ada orang profesional.\n\u201cProfesional itu artinya dari parpol banyak profesional juga di bidangnya. Orang parpol banyak yang profesional. Gitu loh, jadi tidak ada masalah,\u201d kata politikus Perindo itu.\nArya enggan membahas nama-nama calon menteri yang tengah dipertimbangkan Jokowi. Menurutnya, nama itu hanya diketahui Jokowi seorang.\n\u201cPak Jokowi pasti udah lah, sudah ada. Sudah dikantongi, beliau mempertimbangkan banyak hal. Itu aja sih,\u201d ucapnya.\nSebelumnya, Presiden Joko Widodo membeberkan Kabinet Kerja Jilid II ke depan akan fokus pada tiga hal. Yaitu penguatan fondasi pada penyelesaian proyek infrastruktur, pembangunan sumber daya manusia, dan reformasi birokrasi.\nPresiden Joko Widodo dalam wawancara khusus dengan Tim LKBN ANTARA di Istana Merdeka Jakarta, Rabu (12/6). Dia mengatakan Indonesia sebagai negara besar memerlukan fondasi-fondasi yang kuat agar bisa bersaing dengan negara-negara lain.\n\u201cFondasi itu diperlukan dalam rangka kompetisi kita dengan negara-negara lain dan saya melihat memang kenapa kita lima tahun ke belakang kita fokus pada infrastruktur karena stok infrastruktur kita, kita lihat memang masuk baru pada angka baru 37 persen,\u201d kata Jokowi.\nSumber : merdeka.com","urlphoto","https://partaiperindo.com/wp-content/uploads/2019/06/Screenshot_113.jpg","tglposting","14 Jun 2019  -  Pukul 11:42",t,s,"author_urlphoto",r],q,q),P.e(["id","9","title","TKN Yakin Jokowi Ajak Profesional Masuk Kabinet Kerja Jilid II","news","JAKARTA \u2013 Juru Bicara Tim Kampanye Nasional Jokowi-Ma\u2019ruf, Arya Sinulingga meyakini bahwa Presiden Joko Widodo atau Jokowi akan menarik orang-orang profesional dalam Kabinet Kerja Jilid II. Menurut Arya, kriteria tersebut yang dicari Jokowi untuk membantunya pada periode kedua.\n\u201cYang penting profesional pasti,\u201d ucapnya kepada wartawan, Kamis (13/6/2019).\nProfesional yang dimaksud, menurut Arya, tidak medikotomi antara profesional dengan kader partai politik. Kata dia, dari kalangan partai pun ada orang profesional.\n\u201cProfesional itu artinya dari parpol banyak profesional juga di bidangnya. Orang parpol banyak yang profesional. Gitu loh, jadi tidak ada masalah,\u201d kata politikus Perindo itu.\nArya enggan membahas nama-nama calon menteri yang tengah dipertimbangkan Jokowi. Menurutnya, nama itu hanya diketahui Jokowi seorang.\n\u201cPak Jokowi pasti udah lah, sudah ada, sudah dikantongi. Beliau mempertimbangkan banyak hal. Itu aja sih,\u201d ucapnya.\nSebelumnya, Presiden Jokowi membeberkan Kabinet Kerja Jilid II ke depan akan fokus pada tiga hal. Yaitu penguatan fondasi pada penyelesaian proyek infrastruktur, pembangunan sumber daya manusia, dan reformasi birokrasi.\nDalam wawancara khusus dengan Tim LKBN ANTARA di Istana Merdeka Jakarta, Rabu, 12 Juni kemarin, Jokowi mengatakan Indonesia sebagai negara besar memerlukan fondasi-fondasi yang kuat agar bisa bersaing dengan negara-negara lain.\n\u201cFondasi itu diperlukan dalam rangka kompetisi kita dengan negara-negara lain dan saya melihat memang kenapa kita lima tahun ke belakang kita fokus pada infrastruktur karena stok infrastruktur kita, kita lihat memang masuk baru pada angka baru 37 persen,\u201d ungkapnya.\nSumber : liputan6.com","urlphoto","https://partaiperindo.com/wp-content/uploads/2019/06/Screenshot_112.jpg","tglposting","14 Jun 2019  -  Pukul 11:34",t,s,"author_urlphoto",r],q,q)],[[P.F,P.m,P.m]])})
